local FakeName = "NEVER_GONNA_GIVE_YOU_UP"
local Plr = game.Players.LocalPlayer

for Index, Value in next, game:GetDescendants() do 
    if Value.ClassName == "TextLabel" then 
        local has = string.find(Value.Text,Plr.Name) 
        if has then 
            local str = Value.Text:gsub(Plr.Name,FakeName)
            Value.Text = str 
        end
        Value:GetPropertyChangedSignal("Text"):Connect(function()
            local str = Value.Text:gsub(Plr.Name,FakeName)
            Value.Text = str 
        end)
    end
end
 
game.DescendantAdded:Connect(function(Value)
    if Value.ClassName == "TextLabel" then 
        local has = string.find(Value.Text,Plr.Name)
        Value:GetPropertyChangedSignal("Text"):Connect(function()
            local str = Value.Text:gsub(Plr.Name,FakeName)
            Value.Text = str 
        end)
        if has then 
            local str = Value.Text:gsub(Plr.Name,FakeName)
            Value.Text = str 
        end
 
    end
end)
